import React from "react";
import Logo from "./logo";

function Navigation(){
    return(
       <div style={{display: "flex", flexWrap : "wrap"}}>
        <Logo />
         < div style={{display: "flex", justifyContent: "flex-end"}}>
         <nav>
            <p>Sign Out</p>
        </nav>
         </div>
       </div>
    )
}

export default Navigation;
